    {id: 'q1', author: 'David', text:'The Disease'},
    {id: 'q2', author: 'David J Meyer', text: 'Life or Death'},
];

const AllQuotes = () => {
    return (
        <QuoteList quotes={DUMMY} />
    );
};

export default AllQuotes;
